// import cardimg3 from '../../Data/images/flash sale/1 (1).jpg'
// import cardimg4 from '../../Data/images/flash sale/1 (2).jpg'
// import cardimg5 from '../../Data/images/flash sale/1 (3).jpg'
import './SecondPage.css'
import headerimg from '../../Data/images/Second Page/headerIMG/1152_x_252_eng.png'
import { Col, Row } from 'react-bootstrap'
import { Categories } from '../../Data/data'
import { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import { useDispatch, useSelector } from "react-redux";
import { reducer } from '../redux/reducers/Redux'
import { appearCat } from '../redux/actions/ReduxActions'




const SecondPage = ({ ProductsPage, Categoties, Cat }) => {
    // console.log(ProductsPage)

    const [cat2, setCat2] = useState([])
    // const NewArray = []
    // for (let i in Categories.supermarket) {
    // for (let f in Categories.supermarket[i]) {
    // for (let g in Categories.supermarket[i][f]) {
    // NewArray.push(Categories.supermarket[i][f][g])
    // }
    // }
    // }

    const appearCat2 = () => {
        const NewArray = []
        for (let i in ProductsPage) {
            for (let f in ProductsPage[i]) {
                for (let g in ProductsPage[i][f]) {
                    NewArray.push(ProductsPage[i][f][g])
                    setCat2(NewArray)
                }
            }
        }
    }

    const appearCategory = useSelector((state) => state.reducer.array1)
    console.log(appearCategory)
    const dispatch1 = useDispatch()


    console.log(appearCategory)

    useEffect(() =>
        dispatch1(appearCat)
        , [])
    useEffect(() =>
        appearCat2()
        , [])

    // console.log(cat2)
    return (
        <div className="whole-page2">
            <div className="page2-insider">
                <div className="headerimg">
                    <img src={headerimg} alt='headerimg' />
                </div>
                <div className='whole-products'>
                    <Row>
                        <Col lg='3'>
                            <div className='filter'>
                                <div className='filter-insider'>
                                    <div className='Categotries'>
                                        {
                                            appearCategory?.map((item, index) => {
                                                return (
                                                    <Link className='linkCat' to={item.to} key={index}>
                                                        <div>{item.title}</div>
                                                    </Link>
                                                )
                                            })}
                                    </div>
                                    <div className='brands'>
                                        <div className='brand'>BRANDS</div>
                                        <input className='searchInput' type='text' placeholder='Search' />
                                        <div className='checkboxs'>
                                            <div>
                                                <input type="checkbox" id="1" name="fname" />
                                                <label for="1">Abu Auf</label>
                                            </div>
                                            <div>
                                                <input type="checkbox" id="2" name="fname" />
                                                <label for="2">Alaseal</label>
                                            </div>
                                            <div>
                                                <input type="checkbox" id="3" name="fname" />
                                                <label for="3">Al Qahawi</label>
                                            </div>
                                            <div>
                                                <input type="checkbox" id="4" name="fname" />
                                                <label for="4">Al Rahman</label>
                                            </div>
                                            <div>
                                                <input type="checkbox" id="5" name="fname" />
                                                <label for="5">AlRehb</label>
                                            </div>
                                        </div>
                                    </div>
                                    <div className='discount'>
                                        <div>DISCOUNT</div>
                                        <div className='line1'>
                                            <input type="checkbox" id="discount" name="fname" />
                                            <label for="discount">Show only discounted items</label>
                                        </div>
                                    </div>
                                    <div className='price'>
                                        <div className='head-price'>
                                            <div>PRICE</div>
                                            <button>APPLY</button>
                                        </div>
                                        <input type='range' />
                                        <div>
                                            <input type='number' />
                                            -
                                            <input type='number' />
                                        </div>
                                    </div>
                                    <div className='product-rating'>
                                        <div className='first-line'>PRODUCT RATING</div>
                                        <div className='rate-list'>
                                            <div>
                                                <input type="radio" id="rate1" name="fname" />
                                                <label for="rate1">4 Stars & above</label>
                                            </div>
                                            <div>
                                                <input type="radio" id="rate2" name="fname" />
                                                <label for="rate2">3 Stars & above</label>
                                            </div>
                                            <div>
                                                <input type="radio" id="rate3" name="fname" />
                                                <label for="rate3">2 Stars & above</label>
                                            </div>
                                            <div>
                                                <input type="radio" id="rate4" name="fname" />
                                                <label for="rate4">1 Stars & above</label>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </Col>
                        <Col lg='9'>
                            <div className='products'>
                                <div className='first-line'>Supermarket (<span>{cat2.length} products found</span>)</div>
                                {/* <Col lg='12'> */}
                                <div className='card-raws'>
                                    {/* <div className='single-card2'> */}
                                    {/* <div className='single-card2-insider'> */}
                                    {/* <div className='cardimg'> */}
                                    {/* <img src={cardimg3} alt='cardimg1' width={'220px'} /> */}
                                    {/* </div> */}
                                    {/* <div> */}
                                    {/* <div className='title'>Taha Offer Flexble Brush</div> */}
                                    {/* <div className='newprice'>EGP 29.99</div> */}
                                    {/* <div className='oldprice' >EGP 75.00</div> */}
                                    {/* <div className='items-left'>3 items left</div> */}
                                    {/* </div> */}
                                    {/* <div className='disapeared-button'> */}
                                    {/* <button>ADD TO CART</button> */}
                                    {/* </div> */}
                                    {/* </div> */}
                                    {/* </div> */}
                                    {
                                        cat2.length >= 1 ? cat2.map((item, key) => {
                                            return (
                                                <div key={key} className='single-card2'>
                                                    <img src={item.src} alt='cardimg1' width={'220px'} />
                                                    <div>
                                                        <div className='title'>{item.name}</div>
                                                        <div className='newprice'>{item.price}</div>
                                                        <div className='oldprice' >{item.oldprice}</div>
                                                        {/* <div className='items-left'>3 items left</div> */}
                                                    </div>
                                                </div>
                                            )
                                        }) : (<h1>Sorry ,There is no items right now </h1>)
                                    }
                                </div>
                            </div>
                        </Col>
                    </Row>
